module.exports = JSON.parse('[{"postNum":1,"title":"What is Next.js?","date":"2022.05.16.","id":1519211809934,"content":"Next.js is a React framework that gives you building blocks to create web applications. By framework, we mean Next.js handles the tooling and configuration needed for React, and provides additional structure, features, and optimizations for your application. You can use React to build your UI, then incrementally adopt Next.js features to solve common application requirements such as routing, data fetching, integrations - all while improving the developer and end-user experience. Whether youre an individual developer or part of a larger team, you can leverage React and Next.js to build fully interactive, highly dynamic, and performant web applications. "},{"postNum":2,"title":"What is React?","date":"2022.05.17.","id":1519211810362,"content":"React is a JavaScript library for building interactive user interfaces. By user interfaces, we mean the elements that users see and interact with on-screen."},{"postNum":3,"title":"How Next.js Works","date":"2022.05.18.","id":1519211811670,"content":"The environment where your code runs: Development vs. Production. When your code runs: Build Time vs. Runtime. Where rendering happens: Client vs. Server"},{"postNum":4,"title":" ","date":"2022.05.19.","id":1519129853500,"content":""}]');

